import React, { useState } from 'react';
import { Line, Doughnut, Bar } from 'react-chartjs-2';
import 'chart.js/auto';
import './App.css';

const mockSensorHistory = Array.from({ length: 100 }, (_, i) => ({
  value: 400 + Math.round(Math.random() * 200 + (i > 95 ? i * 10 : 0)),
  time: new Date(Date.now() - (100 - i) * 60000).toLocaleTimeString(),
  status: i === 99 ? 'Major Burst' : 'Normal',
}));

const mockStats = {
  avg: 513,
  peak: 2083,
  alertRate: 1.0,
  total: 100,
};

const mockStatusDist = {
  labels: ['Normal', 'Leak Detected', 'Major Burst'],
  datasets: [
    {
      data: [97, 2, 1],
      backgroundColor: ['#00ffb3', '#ffd700', '#ff005c'],
      borderWidth: 0,
    },
  ],
};

const mockHourly = {
  labels: ['14:00', '15:00', '16:00', '17:00', '18:00', '19:00', '20:00', '21:00'],
  datasets: [
    {
      label: 'Avg Value',
      data: [400, 500, 600, 700, 1200, 0, 0, 0],
      backgroundColor: '#00fff7',
      borderRadius: 8,
    },
  ],
};

const mockAlerts = [
  { type: 'Major Burst', value: 2083, time: '14:41', level: 'HIGH' },
];

export default function Analytics() {
  const [range, setRange] = useState('24h');

  const lineData = {
    labels: mockSensorHistory.map((d) => d.time),
    datasets: [
      {
        label: 'Sensor Value',
        data: mockSensorHistory.map((d) => d.value),
        borderColor: '#00fff7',
        backgroundColor: 'rgba(0,255,247,0.1)',
        pointBackgroundColor: mockSensorHistory.map((d) => d.status === 'Major Burst' ? '#ff005c' : '#00fff7'),
        pointRadius: mockSensorHistory.map((d) => d.status === 'Major Burst' ? 5 : 2),
        tension: 0.2,
      },
    ],
  };

  return (
    <div className="analytics-bg">
      <div className="analytics-header">
        <button className="back-btn" onClick={() => window.history.back()}>&larr; Back to Dashboard</button>
        <h1 className="analytics-title">Detailed Analytics</h1>
        <div className="analytics-actions">
          <button className="analytics-btn">Refresh</button>
          <button className="analytics-btn">Export</button>
        </div>
      </div>
      <div className="analytics-controls">
        <select value={range} onChange={e => setRange(e.target.value)} className="analytics-select">
          <option value="24h">Last 24 Hours</option>
          <option value="7d">Last 7 Days</option>
          <option value="30d">Last 30 Days</option>
        </select>
        <span className="analytics-meta">100 readings - Last update: {new Date().toLocaleString()}</span>
      </div>
      <div className="analytics-stats-row">
        <div className="analytics-stat-card">
          <div className="stat-value">{mockStats.avg}</div>
          <div className="stat-label">Average Value</div>
        </div>
        <div className="analytics-stat-card">
          <div className="stat-value">{mockStats.peak}</div>
          <div className="stat-label">Peak Value</div>
        </div>
        <div className="analytics-stat-card">
          <div className="stat-value">{mockStats.alertRate}%</div>
          <div className="stat-label">Alert Rate</div>
        </div>
        <div className="analytics-stat-card">
          <div className="stat-value">{mockStats.total}</div>
          <div className="stat-label">Total Readings</div>
        </div>
      </div>
      <div className="analytics-main-graph">
        <div className="analytics-graph-title">Sensor Value Timeline</div>
        <Line data={lineData} options={{
          responsive: true,
          plugins: { legend: { display: false } },
          scales: {
            x: { title: { display: true, text: 'Time', color: '#00fff7' }, ticks: { color: '#b0eaff' }, grid: { color: 'rgba(0,255,247,0.1)' } },
            y: { title: { display: true, text: 'Sensor Value', color: '#00fff7' }, ticks: { color: '#b0eaff' }, grid: { color: 'rgba(0,255,247,0.1)' } },
          },
        }} />
      </div>
      <div className="analytics-bottom-row">
        <div className="analytics-pie">
          <div className="analytics-graph-title">Status Distribution</div>
          <Doughnut data={mockStatusDist} options={{ plugins: { legend: { labels: { color: '#00fff7', font: { size: 14 } } } } }} />
        </div>
        <div className="analytics-bar">
          <div className="analytics-graph-title">Hourly Average Values</div>
          <Bar data={mockHourly} options={{
            plugins: { legend: { display: false } },
            scales: {
              x: { title: { display: true, text: 'Hour of Day', color: '#00fff7' }, ticks: { color: '#b0eaff' }, grid: { color: 'rgba(0,255,247,0.1)' } },
              y: { title: { display: true, text: 'Avg Value', color: '#00fff7' }, ticks: { color: '#b0eaff' }, grid: { color: 'rgba(0,255,247,0.1)' } },
            },
          }} />
        </div>
      </div>
      <div className="analytics-alert-history">
        <div className="analytics-graph-title">Alert History</div>
        {mockAlerts.map((alert, i) => (
          <div className="analytics-alert-card" key={i}>
            <span className="alert-type">{alert.type}</span>
            <span className="alert-value">Value: {alert.value} - {alert.time}</span>
            <span className="alert-level high">HIGH</span>
          </div>
        ))}
      </div>
    </div>
  );
}
